DROP TABLE IF EXISTS `sys_options`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `sys_options` (
  `op_id` int NOT NULL AUTO_INCREMENT,
  `op_title` varchar(256) DEFAULT NULL COMMENT '标题',
  `op_key` varchar(256) DEFAULT NULL COMMENT '名称键',
  `op_value` mediumtext COMMENT '记录值',
  `op_remake` varchar(256) DEFAULT NULL COMMENT '备注',
  `is_delete` tinyint DEFAULT '0' COMMENT '逻辑删除',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`op_id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COMMENT='操作码表';
